<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <meta name="ad.size" content="width=300,height=250">
  <style>
    .ad-container, svg{
      width: 300px;
      height: 250px;
    }
    
    .ad-container {
      
      background-image: linear-gradient(
      135deg,
      rgb(250, 230, 117),
      rgb(243, 205, 0)
      );
      background-size: auto 100%;
      overflow: hidden;
      position: relative;
    }
    
    
    
    /* PROGRESS BAR */
    
    .progress-bar-container {
      width: 100%;
      height: 1px;
      border-radius: 3px;
      overflow: hidden;
      position: absolute;
      bottom: 0;
      left: 0;
      right: 0;
    }
    
    .progress-bar {
      height: 100%;
      width: 0%;
      background: rgb(37, 31, 24);
      border-radius: 3px;
      animation: progressBarAnim 15s linear forwards;
    }
    
    @keyframes progressBarAnim {
      from {
        width: 0%;
      }
      to {
        width: 100%;
      }
    }
    
    
    /* ANIMATION */
    path,
    rect {
      opacity: 0;
    }
    
    /* S1 */
    #a1 {
      animation: fadeIn 200ms forwards 0ms, fadeOut 200ms forwards 250ms,
      fadeIn 200ms forwards 750ms, fadeOut 200ms forwards 1000ms,
      fadeIn 200ms forwards 1500ms, fadeOut 200ms forwards 1750ms;
    }
    #a2 {
      animation: fadeIn 200ms forwards 250ms, fadeOut 200ms forwards 500ms,
      fadeIn 200ms forwards 1000ms, fadeOut 200ms forwards 1250ms,
      fadeIn 200ms forwards 1750ms, fadeOut 200ms forwards 2000ms;
    }
    #a3 {
      animation: fadeIn 200ms forwards 500ms, fadeOut 200ms forwards 750ms,
      fadeIn 200ms forwards 1250ms, fadeOut 200ms forwards 1500ms;
    }
    #start {
      animation: fadeIn 200ms forwards 750ms, fadeOut 200ms forwards 2000ms;
    }
    
    /* S2 */
    #w {
      animation: fadeIn 200ms forwards 2.3s, fadeOut 200ms forwards 5s;
    }
    #t *{
      animation: fadeIn 1000ms forwards 2.4s, fadeOut 200ms forwards 5s;
    }
    #b1 {
      animation: fadeIn 200ms forwards 2200ms, fadeOut 200ms forwards 2400ms,
      fadeIn 200ms forwards 2800ms, fadeOut 200ms forwards 3000ms,
      fadeIn 200ms forwards 3400ms, fadeOut 200ms forwards 3600ms,
      fadeIn 200ms forwards 4000ms, fadeOut 200ms forwards 4200ms,
      fadeIn 200ms forwards 4600ms, fadeOut 200ms forwards 4800ms;
    }
    #b2 {
      animation: fadeIn 200ms forwards 2400ms, fadeOut 200ms forwards 2600ms,
      fadeIn 200ms forwards 3000ms, fadeOut 200ms forwards 3200ms,
      fadeIn 200ms forwards 3600ms, fadeOut 200ms forwards 3800ms,
      fadeIn 200ms forwards 4200ms, fadeOut 200ms forwards 4400ms,
      fadeIn 200ms forwards 4800ms, fadeOut 200ms forwards 5000ms;
    }
    #b3 {
      animation: fadeIn 200ms forwards 2600ms, fadeOut 200ms forwards 2800ms,
      fadeIn 200ms forwards 3200ms, fadeOut 200ms forwards 3400ms,
      fadeIn 200ms forwards 3800ms, fadeOut 200ms forwards 4000ms,
      fadeIn 200ms forwards 4400ms, fadeOut 200ms forwards 4600ms;
    }
    
    /* S3 */
    #l {
      animation: fadeIn 200ms forwards 5.4s, fadeOut 200ms forwards 7.5s;
    }
    
    #notice {
      animation: fadeIn 200ms forwards 5.4s, fadeOut 200ms forwards 7.5s;
    }

    #c3 {
      animation: 
      fadeIn 200ms forwards 5.3s, fadeOut 200ms forwards 5.5s,
      fadeIn 200ms forwards 5.9s, fadeOut 200ms forwards 6.1s,
      fadeIn 200ms forwards 6.5s, fadeOut 200ms forwards 6.7s,
      fadeIn 200ms forwards 7.1s, fadeOut 200ms forwards 7.3s;
    }
    #c2 {
      animation: 
      fadeIn 200ms forwards 5.5s, fadeOut 200ms forwards 5.7s,
      fadeIn 200ms forwards 6.1s, fadeOut 200ms forwards 6.3s,
      fadeIn 200ms forwards 6.7s, fadeOut 200ms forwards 6.9s,
      fadeIn 200ms forwards 7.3s, fadeOut 200ms forwards 7.5s;
    }
    
    #c1 {
      animation: 
      fadeIn 200ms forwards 5.7s, fadeOut 200ms forwards 5.9s,
      fadeIn 200ms forwards 6.3s, fadeOut 200ms forwards 6.5s,
      fadeIn 200ms forwards 6.9s, fadeOut 200ms forwards 7.1s;
    }

    /* S4 */
    #future, #making, #together {
      animation: fadeIn 200ms forwards 7.7s, fadeOut 200ms forwards 11s;
    }
    
    #j {
      animation: fadeIn 500ms forwards 7.7s, fadeOut 200ms forwards 11s;
    }
    
    #d1 {
      animation: fadeIn 200ms forwards 8s, fadeOut 200ms forwards 8.2s,
      fadeIn 200ms forwards 8.6s, fadeOut 200ms forwards 8.8s,
      fadeIn 200ms forwards 9.2s, fadeOut 200ms forwards 9.4s,
      fadeIn 200ms forwards 9.8s, fadeOut 200ms forwards 10s,
      fadeIn 200ms forwards 10.4s, fadeOut 200ms forwards 10.6s;
    }
    
    #d2 {
      animation: fadeIn 200ms forwards 8.2s, fadeOut 200ms forwards 8.4s,
      fadeIn 200ms forwards 8.8s, fadeOut 200ms forwards 9s,
      fadeIn 200ms forwards 9.4s, fadeOut 200ms forwards 9.6s,
      fadeIn 200ms forwards 10s, fadeOut 200ms forwards 10.2s,
      fadeIn 200ms forwards 10.6s, fadeOut 200ms forwards 10.8s;
    }
    
    #d3 {
      animation: fadeIn 200ms forwards 8.4s, fadeOut 200ms forwards 8.6s,
      fadeIn 200ms forwards 9s, fadeOut 200ms forwards 9.2s,
      fadeIn 200ms forwards 9.6s, fadeOut 200ms forwards 9.8s,
      fadeIn 200ms forwards 10.2s, fadeOut 200ms forwards 10.4s,
      fadeIn 200ms forwards 10.8s, fadeOut 200ms forwards 11s;
    }
    
    /* S5 */
    
    #join {
      animation: fadeIn 200ms forwards 11s;
    }
    
    #logo {
      animation: fadeIn 200ms forwards 11.2s;
    }
    
    #date {
      animation: fadeIn 200ms forwards 11.2s;
    }
    
    #register,
    #btn {
      animation: fadeIn 200ms forwards 11.4s;
    }
    
    @keyframes fadeIn {
      to {
        opacity: 1;
      }
    }
    
    @keyframes fadeOut {
      to {
        opacity: 0;
      }
    }
    
  </style>
</head>
